// DIM Drill Dashboard - React + Tailwind + Supabase Starter (Now with Router + Layout Navigation)

import { useState, useEffect } from 'react';
import { createClient } from '@supabase/supabase-js';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

const supabase = createClient('https://yocwrpuszqwzysikfjrh.supabase.co', 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6InlvY3dycHVzenF3enlzaWtmanJoIiwicm9sZSI6ImFub24iLCJpYXQiOjE3NDQwMTAyMzksImV4cCI6MjA1OTU4NjIzOX0.CX9ibwZL7jrMSEfTqsbhjLMFKeTuuvJ10Q-1KKJmY9E');

export default function App() {
  return (
    <Router>
      <div className="bg-[#1e1e1e] text-[#d0d0d0] min-h-screen p-6 max-w-5xl mx-auto">
        <h1 className="text-4xl font-bold text-orange-500 mb-8">DIM Drill Dashboard</h1>
        <nav className="flex gap-4 mb-8">
          <Link className="bg-orange-600 hover:bg-orange-500 text-white px-4 py-2 rounded" to="/">Home</Link>
          <Link className="bg-blue-600 hover:bg-blue-500 text-white px-4 py-2 rounded" to="/add">Add Drill</Link>
          <Link className="bg-green-600 hover:bg-green-500 text-white px-4 py-2 rounded" to="/library">Drill Library</Link>
        </nav>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/add" element={<DrillDashboard />} />
          <Route path="/library" element={<DrillLibrary />} />
        </Routes>
      </div>
    </Router>
  );
}

function Home() {
  return (
    <div className="space-y-4">
      <p className="text-lg">Welcome to the DIM Drill Dashboard. Choose a section to begin.</p>
    </div>
  );
}

function DrillLibrary() {
  const [drills, setDrills] = useState([]);

  useEffect(() => {
    async function fetchDrills() {
      const { data, error } = await supabase.from('drills').select('*');
      if (!error) setDrills(data);
    }
    fetchDrills();
  }, []);

  return (
    <div>
      <h2 className="text-2xl font-semibold mb-4 text-orange-400">Drill Library</h2>
      <div className="space-y-4">
        {drills.map((drill, index) => (
          <div key={index} className="bg-[#2c2c2c] border border-[#3a3a3a] p-4 rounded shadow">
            <h3 className="text-lg font-bold text-orange-300 mb-2">{drill.name}</h3>
            {Object.entries(drill).map(([key, value]) => (
              key !== 'id' && key !== 'name' ? (
                <p key={key}><strong className="text-blue-400">{key.replace(/_/g, ' ')}:</strong> {value}</p>
              ) : null
            ))}
          </div>
        ))}
      </div>
    </div>
  );
}

export function DrillDashboard() {
  const [drills, setDrills] = useState([]);
  const [newDrill, setNewDrill] = useState({
    name: '', purpose: '', plane: '', muscles: '', joint_actions: '', nervous_system: '',
    psych_component: '', tendons_loaded: '', influences: '', execution_needs: '', regression: '', notes: ''
  });
  const [textBlock, setTextBlock] = useState('');

  async function addDrill() {
    const isEmpty = Object.values(newDrill).every(value => value.trim() === '');
    if (isEmpty) {
      console.warn('Drill is empty — not saving');
      return;
    }
    const { data, error } = await supabase.from('drills').insert([newDrill]).select();
    if (error) {
      console.error('Failed to add drill:', error);
      return;
    }
    if (data && Array.isArray(data)) {
      setDrills([...drills, ...data]);
    } else {
      console.warn('Drill added but no data returned');
    }
    setNewDrill({
      name: '', purpose: '', plane: '', muscles: '', joint_actions: '', nervous_system: '',
      psych_component: '', tendons_loaded: '', influences: '', execution_needs: '', regression: '', notes: ''
    });
    setTextBlock('');
  }

  function handleChange(field, value) {
    setNewDrill({ ...newDrill, [field]: value });
  }

  function parseTextBlock() {
    const lines = textBlock.split('\n');
    const parsed = { ...newDrill };
    lines.forEach(line => {
      const [keyRaw, ...rest] = line.split(':');
      if (!keyRaw || rest.length === 0) return;
      const key = keyRaw.trim().toLowerCase().replace(/\s+/g, '_');
      const value = rest.join(':').trim();
      if (key in newDrill) parsed[key] = value;
    });
    setNewDrill(parsed);
  }

  return (
    <div>
      <div className="mb-12 border border-orange-400 rounded-lg p-4 bg-[#2c2c2c]">
        <h2 className="text-xl font-semibold mb-4 text-orange-400">Paste Full Drill Block</h2>
        <textarea
          className="bg-[#1e1e1e] border border-[#3a3a3a] text-[#d0d0d0] p-2 mb-2 w-full rounded h-40"
          placeholder="Paste your drill block here..."
          value={textBlock}
          onChange={e => setTextBlock(e.target.value)}
        />
        <button
          className="bg-blue-700 hover:bg-blue-600 text-white px-4 py-2 rounded mb-2"
          onClick={parseTextBlock}
        >
          Parse Block</button>
      </div>

      <div className="mb-8">
        <h2 className="text-xl font-semibold mb-4 text-orange-400">Add New Drill</h2>
        {Object.keys(newDrill).map((field, index) => (
          <input
            key={index}
            className="bg-[#2c2c2c] border border-[#3a3a3a] text-[#d0d0d0] p-2 mb-2 w-full rounded"
            placeholder={field.replace(/_/g, ' ').replace(/\b\w/g, l => l.toUpperCase())}
            value={newDrill[field]}
            onChange={e => handleChange(field, e.target.value)}
          />
        ))}
        <button className="bg-orange-600 hover:bg-orange-500 text-white px-4 py-2 rounded" onClick={addDrill}>Add Drill</button>
      </div>
    </div>
  );
}
